import React from 'react';
import './App.css';
import {Route, Switch, Link} from 'react-router-dom'

import {HomePage} from './pages/homepage/homepage.component';

const TopicList = props => {
    return (
        <div>
            <h1>TOPIC LIST PAGE</h1>
            <Link to={`${props.match.url}/11`}>TO TOPIC 13</Link>
            <br/>
            <Link to={`${props.match.url}/15`}> TO TOPIC 15 </Link>
            <br/>
            <Link to={`${props.match.url}/21`}> TO TOPIC 21 </Link>
        </div>
    )
};

const TopicDetail = props => {
    return (
        <div>
            <button onClick={()=> props.history.push('/blog/topics')}>Topics</button>
            <h1>TOPIC DETAIL PAGE: {props.match.params.topicId}</h1>
        </div>
    )
};

function App() {
    return (
        <div>
            <Switch>
                <Route exact path='/' component={HomePage}/>
                <Route exact path='/blog/topics' component={TopicList}/>
                <Route path='/blog/topics/:topicId' component={TopicDetail}/>
                <Route exact path='/blog/awsd/topics' component={TopicList}/>
                <Route path='/blog/awsd/topics/:topicId' component={TopicDetail}/>
            </Switch>
        </div>
    )
}

export default App;
